  \"Inventory of Atlantic White Cedar Remnant Stands in North Carolina.\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 11,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:47:40.184937\",\n\t\"name\": \"inventory-of-atlantic-white-cedar-remnant-stands-in-north-carolina\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This inventory was commissioned by the
  U.S. Air Force to identify the location and condition of extant remnant Atlantic
  white cedar groves and stands in North Carolina, and to compare those sites with
  remnant sites on the Dare County Bombing Range. As such, it is a comprehensive description
  of the remnant Atlantic white cedar resource rather than a standard forest inventory
  that focuses on volumes and stocking. For each site visited, the authors gathered
  data on location, ownership, stand condition and composition, soils, past disturbances
  where known, and natural community types. To identify site locations, records of
  known remnant AWC sites were compiled from Dare County Range files and N.C. Natural
  Heritage Program (NHP) Element Occurrence files and from knowledgeable individuals
  representing public agencies, timber companies, conservation organizations, and
  private landowners. Aerial photographs obtained from U.S. Department o f Agriculture
  offices were studied to identify potential additional sites in approximately 35
  counties. Numerous AWC sites were discovered during aerial and ground inspection
  of known locations.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
